import React from 'react'; 
import "./style.scss";
import copy from "../../assets/fonts/copy/copy.js"

const Home = () => {
    const { PreTitle, Title, Subtitle, Blurb } = copy.Home;
    return (
    <div className="home">
        <div className="home__title">
          <p>PreTitle</p>
          <h1>Title</h1>
        </div>
        <img src="/images/hero.png" className="home__img"/>
    </div>
    )
  }


export default Home;
